This is very, very easy to make work in modern Chrome (and Firefox after you turn on a flag). [These lines](https://github.com/microsoft/onnxruntime/blob/4ebc9c3b5e4cbdd4cdf3e08906fef7ea49fed508/js/web/lib/onnxjs/backends/webgl/webgl-context-factory.ts#L86-L91) that instantiate a canvas element with the DOM can simply be replaced with the following:
```ts
declare var OffscreenCanvas: {
  new(width: number, height: number): HTMLCanvasElement;
}

function createCanvas(): HTMLCanvasElement {
  if (typeof document == 'undefined') {
    if (typeof OffscreenCanvas == 'undefined') {
      throw new TypeError('failed to create canvas: OffscreenCanvas not supported');
    }
    return new OffscreenCanvas(1, 1);
  }
  const canvas: HTMLCanvasElement = document.createElement('canvas');
  canvas.width = 1;
  canvas.height = 1;
  return canvas;
}
```

This actually works almost flawlessly, I'm able to run the entirety of ORT Web in a web worker. @fs-eire if you're able I would really appreciate if you could bring this functionality into ONNX Runtime Web with a `.proxy` flag to automatically use web workers with the WebGL backend - I think that would involve sending the full graph to the web worker and using a `env.webgl.workerPath` option of some kind to construct the worker (since it's probably going to be way too big to inline).

If you can't do that I can just submit a PR with this patch. Then the user must manually make a web worker to use the worker threads.
